<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<style>
    /* Estilos generales */
    .container {
      width: 100%;
      max-width: 600px;
      margin: 0 auto;
      padding: 20px;
    }
  
    .row {
      display: flex;
      justify-content: center;
    }
  
    .col {
      width: 100%;
    }
  
    .text-center {
      text-align: center;
    }
  
    /* Estilos para el input y botón de búsqueda */
    .input-busqueda {
      width: 100%;
      padding: 10px;
      margin-top: 10px;
      border: 1px solid #ccc;
      border-radius: 5px;
      text-align: center;
    }
  
    .btn-buscar {
      width: 100%;
      padding: 10px;
      margin-top: 15px;
      background-color: #007bff;
      color: white;
      border: none;
      border-radius: 5px;
      cursor: pointer;
    }
  
    .btn-buscar:hover {
      background-color: #0056b3;
    }
  
    /* Estilos para los botones de imprimir y descargar */
    .button-container {
      display: flex;
      justify-content: center;
      gap: 10px;
      margin-top: 20px;
    }
  
    .btn-imprimir,
    .btn-descargar {
      padding: 10px 20px;
      border: none;
      border-radius: 5px;
      cursor: pointer;
    }
  
    .btn-imprimir {
      background-color: #007bff;
      color: white;
    }
  
    .btn-imprimir:hover {
      background-color: #0056b3;
    }
  
    .btn-descargar {
      background-color: #28a745;
      color: white;
    }
  
    .btn-descargar:hover {
      background-color: #218838;
    }
  
    /* Estilos para la constancia */
    .constancia {
      border: 1px solid #000;
      padding: 20px;
      margin-top: 20px;
      background-color: #f9f9f9;
    }
  
    .constancia h2 {
      text-align: center;
      margin-bottom: 20px;
    }
  
    .constancia p {
      margin: 10px 0;
    }
  
    .text {
      font-size: 12px; /* Tamaño de fuente base */
      font-family: Arial, sans-serif; /* Fuente por defecto */
      fill: black; /* Color de texto por defecto */
    }
  </style>

            <div class="row">
              <div class="col">
                <label for="busqueda">
                  <p class="text-center">
                    Busca por <strong>Cédula (ej: V-12345678) o Serial (ej: AAA0000AAA0000)</strong>:
                  </p>
                </label>
                <input class="input-busqueda" id="busqueda" placeholder="V-12345678" type="text" pattern="[^\s]+"
                  oninput="this.value = this.value.replace(/\s/g, '');" />
                <button class="btn-buscar" onclick="buscarEmpleado()"><i class="bi bi-search"></i> Buscar</button>

              </div>

      const inputBusqueda = document.getElementById('busqueda');
      inputBusqueda.addEventListener('input', () => {

      function NumeroALetras(num) {
        // [Tu función NumeroALetras aquí - SIN MODIFICACIONES]
        let data = {
              numero: num,
              enteros: Math.floor(num),
              centavos: Math.round((num - Math.floor(num)) * 100),
              letrasCentavos: "",
              letrasMonedaPlural: 'BOLIVARES',
              letrasMonedaSingular: 'BOLIVAR',
              letrasMonedaCentavoPlural: "CENTIMOS",
              letrasMonedaCentavoSingular: "CENTIMO"
            };
      
            function Unidades(num) {
                switch (num) {
                  case 1: return "UN";
                  case 2: return "DOS";
                  case 3: return "TRES";
                  case 4: return "CUATRO";
                  case 5: return "CINCO";
                  case 6: return "SEIS";
                  case 7: return "SIETE";
                  case 8: return "OCHO";
                  case 9: return "NUEVE";
                }
                return "";
              }
          
              function Decenas(num) {
                let decena = Math.floor(num / 10);
                let unidad = num - (decena * 10);
          
                switch (decena) {
                  case 1:
                    switch (unidad) {
                      case 0: return "DIEZ";
                      case 1: return "ONCE";
                      case 2: return "DOCE";
                      case 3: return "TRECE";
                      case 4: return "CATORCE";
                      case 5: return "QUINCE";
                      default: return "DIECI" + Unidades(unidad);
                    }
                  case 2:
                    switch (unidad) {
                      case 0: return "VEINTE";
                      default: return "VEINTI" + Unidades(unidad);
                    }
                  case 3: return DecenasY("TREINTA", unidad);
                  case 4: return DecenasY("CUARENTA", unidad);
                  case 5: return DecenasY("CINCUENTA", unidad);
                  case 6: return DecenasY("SESENTA", unidad);
                  case 7: return DecenasY("SETENTA", unidad);
                  case 8: return DecenasY("OCHENTA", unidad);
                  case 9: return DecenasY("NOVENTA", unidad);
                  case 0: return Unidades(unidad);
                }
              }
          
              function DecenasY(strSin, numUnidades) {
                if (numUnidades > 0)
                  return strSin + " Y " + Unidades(numUnidades);
                return strSin;
              }
          
              function Centenas(num) {
                let centenas = Math.floor(num / 100);
                let decenas = num - (centenas * 100);
          
                switch (centenas) {
                  case 1:
                    if (decenas > 0)
                      return "CIENTO " + Decenas(decenas);
                    return "CIEN";
                  case 2: return "DOSCIENTOS " + Decenas(decenas);
                  case 3: return "TRESCIENTOS " + Decenas(decenas);
                  case 4: return "CUATROCIENTOS " + Decenas(decenas);
                  case 5: return "QUINIENTOS " + Decenas(decenas);
                  case 6: return "SEISCIENTOS " + Decenas(decenas);
                  case 7: return "SETECIENTOS " + Decenas(decenas);
                  case 8: return "OCHOCIENTOS " + Decenas(decenas);
                  case 9: return "NOVECIENTOS " + Decenas(decenas);
                }
                return Decenas(decenas);
              }
          
              function Seccion(num, divisor, strSingular, strPlural) {
                let cientos = Math.floor(num / divisor);
                let resto = num - (cientos * divisor);
                let letras = "";
          
                if (cientos > 0) {
                  if (cientos > 1)
                    letras = Centenas(cientos) + " " + strPlural;
                  else
                    letras = strSingular;
                }
          
                if (resto > 0)
                  letras += " " + Centenas(resto);
          
                return letras;
              }
          
              function Miles(num) {
                let divisor = 1000;
                let cientos = Math.floor(num / divisor);
                let resto = num - (cientos * divisor);
                let strMiles = Seccion(cientos, 1, "UN MIL", "MIL");
                let strCentenas = Centenas(resto);
          
                if (strMiles === "")
                  return strCentenas;
          
                return strMiles + " " + strCentenas;
              }
          
              function Millones(num) {
                let divisor = 1000000;
                let cientos = Math.floor(num / divisor);
                let resto = num - (cientos * divisor);
                let strMillones = Seccion(cientos, 1, "UN MILLON", "MILLONES");
                let strMiles = Miles(resto);
          
                if (strMillones === "")
                  return strMiles;
          
                return strMillones + " " + strMiles;
              }
    
              if (data.centavos > 0) {
                data.letrasCentavos = "CON " + (function () {
                  if (data.centavos == 1)
                    return Decenas(data.centavos) + " " + data.letrasMonedaCentavoSingular;
                  else
                    return Decenas(data.centavos) + " " + data.letrasMonedaCentavoPlural;
                })();
              }
        
              if (data.enteros == 0)
                return "CERO " + data.letrasMonedaPlural + " " + data.letrasCentavos;
              if (data.enteros == 1)
                return Millones(data.enteros) + " " + data.letrasMonedaSingular + " " + data.letrasCentavos;
              else
                return Millones(data.enteros) + " " + data.letrasMonedaPlural + " " + data.letrasCentavos;
          
      }

    // Función para convertir números a letras (puedes usar la función NumeroALetras que ya tienes)
    function NumeroALetrasFecha(num) {
        const unidades = ["UN", "DOS", "TRES", "CUATRO", "CINCO", "SEIS", "SIETE", "OCHO", "NUEVE"];
        const decenas = ["DIEZ", "VEINTE", "TREINTA", "CUARENTA", "CINCUENTA", "SESENTA", "SETENTA", "OCHENTA", "NOVENTA"];
        const especiales = ["ONCE", "DOCE", "TRECE", "CATORCE", "QUINCE", "DIECI", "VEINTI"];
    
        if (num < 10) return unidades[num - 1];
        if (num >= 11 && num <= 15) return especiales[num - 11];
        if (num >= 16 && num <= 19) return "DIECI" + unidades[num - 11];
        if (num === 20) return "VEINTE";
        if (num >= 21 && num <= 29) return "VEINTI" + unidades[num - 21];
        if (num >= 30 && num <= 99) return decenas[Math.floor(num / 10) - 1] + (num % 10 !== 0 ? " Y " + unidades[(num % 10) - 1] : "");
        return "NÚMERO FUERA DE RANGO";
    }
